import { useState } from 'react';
import './App.css';
import SubmitForm from './components/SubmitForm';

function App() {
  const [formData, setFormData] = useState([]);
  return (
    <div className="App">
      <SubmitForm formData={formData} setFormData={setFormData}/>

      <ul>
        {formData.map(item => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
